import React from 'react';
import Auxillary from '../../hoc/Auxillary'
import styles from './Layout.module.css'

const Layout=(props)=>(
<Auxillary>
<div>Tool bar</div>
<main className={styles.content}>{props.children}</main>
</Auxillary>

);

export default Layout;
